import Layout from '../components/Layout';
import Navigation from '../components/Navigation';
import Link from 'next/link';
import fetch from 'isomorphic-unfetch';

function IndexPage() {
    return (
      <>
        <Layout>
          <Navigation />
          <div className="items-center justify-center">
            <div class="container mx-auto flex flex-wrap flex-col md:flex-row items-center"> 
                <div class="flex flex-col w-full md:w-2/5 self-center justify-center items-start text-center md:text-left">
                    <p class="uppercase tracking-loose w-full text-base m-2">An advanced Ethereum mobile wallet</p>
                    <h1 class="my-4 font-bold leading-tight text-5xl m-2">Simple, Secure, Intuitive.</h1>
                    <p class="leading-normal mb-8 text-lg m-2">
                        The very best ethereum tokens at your fingertips. Earn with DeFi, vote on a DAO, use your tokens for more things, pay with a stable coin and access the full web3 world with an in built dapp browser.
                    </p>
                </div>
            </div>
          </div>
        </Layout>
      </>
    )
  }

  export default IndexPage;
